import React from 'react';
import Users from '../components/Users';
import Products from '../components/Products';

const AdminHome = () => {
  return (
    <div>
      <h1>Admin Panel</h1>
      <div className="section">
        <Users />
      </div>
      <div className="section">
        <Products />
      </div>
    </div>
  );
};

export default AdminHome;
